import { Component } from 'react';

class Controller extends Component{
    render() {
        return(
          <ul>
          <li><a href="/create">create</a></li>
          <li><a href="/update">update</a></li>
          <li><input type="button" value="delete"></input></li>
        </ul>
        );
    }
}

export default Controller;
